"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Coughing up blood (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/coughing-up-blood-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H81822447\">",
"      <span class=\"h1\">",
"       What is coughing up blood?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Coughing up blood is when people cough up blood (by itself) or blood mixed with mucus. When mucus has blood in it, it can have streaks of blood, or the mucus can turn red or pink. The term doctors use for coughing up blood is &ldquo;hemoptysis.&rdquo; Coughing up blood can happen in adults and older children, but it is uncommon in young children.",
"     </p>",
"     <p>",
"      When a person coughs up blood, it means the blood is coming from their airways or lungs (",
"      <a class=\"graphic graphic_figure graphicRef67527 \" href=\"UTD.htm?40/17/41237\">",
"       figure 1",
"      </a>",
"      ). Bleeding from the nose or stomach can look like coughing up blood, but it is not the same.",
"     </p>",
"     <p>",
"      If people cough up a lot of blood, doctors call it &ldquo;massive hemoptysis.&rdquo; This can be a medical emergency. This article discusses coughing up blood that is not a medical emergency.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H81822462\">",
"      <span class=\"h1\">",
"       What causes people to cough up blood?",
"      </span>",
"      &nbsp;&mdash;&nbsp;In adults, there are many causes of coughing up blood, but the most common causes are:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Bronchitis &ndash; Bronchitis means inflammation of the bronchi. The bronchi are the tubes that carry air into the lungs (",
"        <a class=\"graphic graphic_figure graphicRef67527 \" href=\"UTD.htm?40/17/41237\">",
"         figure 1",
"        </a>",
"        ). There are 2 types of bronchitis. &ldquo;Acute&rdquo; bronchitis is an infection of the bronchi. &ldquo;Chronic&rdquo; bronchitis is a condition in which the airways (tubes that carry air within the lungs) get damaged.",
"       </li>",
"       <li>",
"        Infections of the lungs, such as pneumonia",
"       </li>",
"       <li>",
"        Bronchiectasis &ndash; This is a condition in which the airways are damaged and get infected easily. It has different causes.",
"       </li>",
"       <li>",
"        Cancer that affects the bronchi or airways",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      In children, the most common causes of coughing up blood are:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        An infection of the bronchi, airways, or lungs",
"       </li>",
"       <li>",
"        Having an object or piece of food stuck in the airway. The object might be stuck for days or weeks before a child starts coughing up blood.",
"       </li>",
"       <li>",
"        Bronchiectasis &ndash; In children, this is usually caused by &ldquo;cystic fibrosis,&rdquo; which is a condition some children are born with. Cystic fibrosis causes thick mucus to build up in the lungs, which leads to frequent lung infections.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H81822477\">",
"      <span class=\"h1\">",
"       Should I call a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Any time you or your child coughs up blood or mucus mixed with blood, call the doctor or nurse right away.",
"     </p>",
"     <p>",
"      Let the doctor or nurse know if you remember seeing your child choke on something, even if it was days or weeks ago.",
"     </p>",
"     <p>",
"      If you cough up a very large amount of blood (about 1 cup or more), or are having trouble breathing, call 9-1-1 for ambulance.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H81822492\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Maybe. Your doctor or nurse will ask about your symptoms and do an exam. Based on your symptoms and other factors, he or she might do tests. These tests can help your doctor or nurse find out why you&rsquo;re bleeding and where the bleeding is coming from.",
"     </p>",
"     <p>",
"      Different tests can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        A chest X-ray",
"       </li>",
"       <li>",
"        Lab tests &ndash; These might include blood tests or tests on a sample of the mucus you cough up.",
"       </li>",
"       <li>",
"        Bronchoscopy &ndash; This is a procedure in which a doctor uses a thin tube (called a &ldquo;bronchoscope&rdquo;) to look inside your airways.",
"       </li>",
"       <li>",
"        A CT scan &ndash; This is an imaging test that creates pictures of the inside of your body.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H81822509\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to stop coughing up blood?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Teenagers and adults who have streaks of blood in their mucus can try to quiet their cough by using an over-the-counter cough medicine.",
"     </p>",
"     <p>",
"      But do NOT give any cough or cold medicines to young children. These medicines are unlikely to help and can have serious side effects in young children.",
"     </p>",
"     <p>",
"      If you smoke cigarettes, the most helpful thing you can do is stop smoking.",
"     </p>",
"     <p>",
"      If you take a medicine that keeps blood clots from forming (a &ldquo;blood thinning&rdquo; medicine), let your doctor or nurse know. He or she might change your dose.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H81822524\">",
"      <span class=\"h1\">",
"       How is coughing up blood treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If your symptoms are mild and happen only with a common cold, you might not need treatment.",
"     </p>",
"     <p>",
"      If you do need treatment, your doctor will treat the condition that&rsquo;s causing you to cough up blood. He or she can also help stop the bleeding by:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Prescribing a cough medicine to keep you from coughing",
"       </li>",
"       <li>",
"        Prescribing an antibiotic if you have bronchiectasis or an infection",
"       </li>",
"       <li>",
"        Doing a procedure during bronchoscopy to stop the bleeding",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H81822539\">",
