var title_f21_43_22200="Blocked APB tutorial";
var content_f21_43_22200=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F70469&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F70469&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1046px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Blocked atrial premature beat",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 428px; height: 148px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Nonconducted or blocked atrial premature beats occur when there is premature activation of the atrial myocardium from an ectopic atrial focus at a time when the atrioventricular node is still refractory due to the previous sinus beat. Since the block is in the atrioventricular node, there is an isolated or nonconducted P wave seen on the ECG. In this case, the P wave is located within T wave of the first beat.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 456px\">",
"   <div class=\"ttl\">",
"    Sinus rhythm",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 456px; height: 103px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The normal P wave in sinus rhythm is slightly notched since activation of the right atrium precedes that of the left atrium. The P wave is upright in a positive direction in leads I and II. A P wave with a uniform morphology precedes each QRS complex. The rate is between 60 and 100 beats per minute and the cycle length is uniform between sequential P waves and QRS complexes. In addition, the P wave morphology and PR intervals are identical from beat to beat.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
