var title_f21_43_22203="NCCN risk factors for cutaneous SCC recurrence";
var content_f21_43_22203=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=DERM%2F83683&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=DERM%2F83683&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Features identified by the National Comprehensive Cancer Network as risk factors for recurrence of cutaneous squamous cell carcinoma",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Location/size*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Poorly-defined borders",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Recurrent tumors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Immunosuppressed patient",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Site of previous radiation therapy or chronic inflammation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rapidly growing tumor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neurologic symptoms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Moderately or poorly differentiated tumor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Adenoid (acantholytic), adenosquamous, or desmoplastic subtypes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Depth &ge;2 mm or Clark level IV or V",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Perineural or vascular involvement",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Size &ge;20 mm on trunk or extremities; size &ge;10 mm on cheeks, forehead, scalp, or neck; size &ge;6 mm on \"mask areas\" of the face (central face, eyelids, eybrows, periorbital nose, lips [cutaneous and vermilion], chin, mandible, preauricular and postauricular skin/sulci, temple, ear, genitalia, hands, and feet).",
"    </div>",
"    <div class=\"reference\">",
"     Source: Miller SJ, Alam M, Anderson J, et al. NCCN Clinical Practice Guidelines in Oncology (NCCN Guidelines): Basal Cell and Squamous Cell Skin Cancers, 2nd ed, National Comprehensive Cancer Network, 2011.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
